import React from "react";

export default function Register() {
  return (
    <>
      <div className="bg-info w-75 m-auto py-5">
        <h2>Registeration Form</h2>
        <form>
          <div className="input-data">
            <label htmlFor="fir"></label>
          </div>
        </form>
      </div>
    </>
  );
}
